The template class to use for new items. This should be a constructor.
Objects should be created by extending Ember.Object.
 ```javascript
 Ember.Object.extend({
   init() {
     this._super(...arguments);

     this.set('foo', A());
     this.set('bar', A());
   }
 })
 ```

Validates drag events. Override this to restrict which data types your
component accepts.

Example:

```js
validateDragEvent: function(event) {
  return event.dataTransfer.types.contains('text/x-foo');
}
```
